import React, { Component } from 'react';
import './DataView.css';

class DataView extends Component {
    render() {
        return (
            <div className="dataView">
                <h2>Sensors' Data</h2>
                <p>Not Available Yet!</p>
            </div>
        );
    }
}

export default DataView;
